class Solution:
    def countVowels(self, word: str) -> int:
        N = len(word)
        res = 0
        vowels = set(['a','e','i','o','u'])
        for k in range(0, N):
            if word[k] in vowels:
                res += (N-k)*(1+k)
        return res

